import { Route, Routes } from "react-router";
import React from 'react';
import { routes } from "./router/routes";

const AppRouter = () => {
    return (
        <Routes>
            {routes.map(route =>
                <Route
                    component={route.component}

                />
            )}
        </Routes>
    )
}

export default AppRouter;
